import React from 'react';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import { makeStyles } from '@material-ui/core/styles';
import FacebookIcon from '@material-ui/icons/Facebook';
import AppleIcon from '@material-ui/icons/Apple';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import './index.scss';

const useStyles = makeStyles((theme) => ({
  image: {
    backgroundImage: 'url(https://source.unsplash.com/random)',
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[50] : theme.palette.grey[900],
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  },
  paper: {
    margin: theme.spacing(8, 4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  logoBig:{
    marginTop: 22,
    marginBottom: 40,
    backgroundColor: '#DEDEDE',
    color: '#FFFFFF',
  },
 loginButton: {
    backgroundColor: '#4E5674',
    borderRadius: 10,
    width: 300,
    height: 50,
  },
  groupbtn:{
    //marginTop: 40,
    marginBottom: 40,
  },
  btnFace:{
    width: 300,
    borderRadius: 10,
    marginBottom: 20,
    backgroundColor: '#1877F2',
    color: 'white',
  },
  btnGoogle:{
    width: 300,
    borderRadius: 10,
    marginBottom: 20,
    backgroundColor: '#FFFFFF',
    color: 'black',
  },
  btnApple:{
    width: 300,
    borderRadius: 10,
    marginBottom: 20,
    backgroundColor: '#000000',
    color: 'white',
  },
  btnLink:{
    width: 300,
    borderRadius: 10,
    marginBottom: 20,
    backgroundColor: '#FFFFFF',
    color: '#0A66C2',
  },
  groupButtons:{
    backgroundColor: '#F5F5F5',
    color: '#8F8F8F',
  },
}));

export const RegisterOne = () => {
  const classes = useStyles();

  return (
    <Grid container component="main" className={classes.root}>

      <Grid item xs={false} sm={3} md={3} className={classes.image} />
      <Grid item xs={12} sm={9} md={9} component={Paper} elevation={6} square>
        <div className={classes.paper}>
          <Button variant="contained" className={classes.logoBig}>Logo</Button>
          <ButtonGroup disableElevation variant="contained" >
            <Button className={classes.groupButtons}>Soy un usuario</Button>
            <Button className={classes.groupButtons}>Soy un profesional</Button>
          </ButtonGroup>
          <div className={classes.groupbtn}>

          </div>
          <Button variant="contained" className={classes.btnFace}> <FacebookIcon/>Continuar con Facebook</Button>
          <Button variant="contained" className={classes.btnGoogle}> Continuar con  Google</Button>
          <Button variant="contained" className={classes.btnApple}><AppleIcon/>Continuar con Apple</Button>
          <Button variant="contained" className={classes.btnLink}><LinkedInIcon/>Continuar con Linkedin</Button>
          <div className='login'>
              <Button
                type="submit"
                variant="contained"
                color="primary"
                className={classes.loginButton}
              >
                Sing up
              </Button>  
            </div>
        </div>
      </Grid>
    </Grid>
  );
}
